import { useNavigate } from "react-router-dom";

function CheckoutSuccessPage() {
  const navigate = useNavigate();
  function prevToHomePage() {
    navigate("/");
  }

  return (
    <div className="fixed inset-0 bg-gray-800 bg-opacity-50 flex justify-center items-center z-50">
      <div className="bg-white p-6 w-full max-w-md rounded-lg shadow-lg">
        <svg
          viewBox="0 0 24 24"
          className="text-green-600 w-16 h-16 mx-auto my-6"
        >
          <path
            fill="currentColor"
            d="M12,0A12,12,0,1,0,24,12,12.014,12.014,0,0,0,12,0Zm6.927,8.2-6.845,9.289a1.011,1.011,0,0,1-1.43.188L5.764,13.769a1,1,0,1,1,1.25-1.562l4.076,3.261,6.227-8.451A1,1,0,1,1,18.927,8.2Z"
          ></path>
        </svg>
        <div className="text-center">
          <h3 className="md:text-2xl text-base text-gray-900 font-semibold">
            Payment Done!
          </h3>
          <p className="text-gray-600 my-2">
            Thank you for completing your secure online payment.
          </p>
          <p className="dark:text-black">Have a great day!</p>
          <div className="py-10 text-center">
            <button
              className="px-12 bg-indigo-600 hover:bg-indigo-500 text-white font-semibold py-3"
              onClick={prevToHomePage}
            >
              GO BACK
            </button>
          </div>
        </div>
      </div>
    </div>
  );
}

export default CheckoutSuccessPage;
